import React from "react";

const ContactMe = () => {
  return (
    <div className="ContactPage">
      <div className="Main">
        <div className="flex">
          <div className="icon"></div>
          <div className="form"></div>
        </div>
        <div className="socials"></div>
      </div>
    </div>
  );
};

export default ContactMe;
